import FloatingLabel from "react-bootstrap/FloatingLabel";
import Form from "react-bootstrap/Form";
import "./basic.css";
import ProductItem from "./ProductItem";
function BasicExample({ product }) {
  const { imageUrl, productName, productPrice } = product;
  const [title, setTitle] = useState(productName);
  const [count, SetCount] = useState(productPrice);
  return (
    <div className="w-50 m-4">
      <FloatingLabel
        controlId="floatingInput"
        label="Ürün Adı Giriniz..."
        className="mb-3"
      >
        <Form.Control type="email" placeholder="name@example.com" />
      </FloatingLabel>
      <FloatingLabel controlId="floatingPassword" label="Ürün Fiyatı ₺">
        <Form.Control type="password" placeholder="Ürün Fiyatı Giriniz..." />
      </FloatingLabel>
      <FloatingLabel
        controlId="floatingPassword"
        label="Ürün Görseli Giriniz..."
        className="mt-3"
      >
        <Form.Control type="text" placeholder="Ürün Fiyatı Giriniz..." />
      </FloatingLabel>
      <button className="btn btn-danger mt-3">Ürün Ekle</button>
      <div className="d-flex gap-4">
        <ProductItem />
        <ProductItem />
      </div>
    </div>
  );
}

export default BasicExample;
